> Texas Rangers in playoffs, near AL West title after edging Angels Texas Rangers closer Shawn Tolleson laughs as Elvis Andrus, center, and Rougned Odor (12) parade in front of him with coolers of cold liquid before dunking him after their baseball game against the Los Angeles Angels Thursday, Oct. 1, 2015, in Arlington, Texas. The Rangers clinched a wild-card spot and moved to the cusp of the AL West title, with Adrian Beltre's three-run double backing Derek Holland in a 5-3 victory over the Angels on Thursday night. (AP Photo/Tony Gutierrez) 
